体に必要な水分、ミネラルを素早く摂取！<br><br>体に必要な水分、ミネラルを素早く摂取！<br>甘さ控えめのカロリーオフ、アミノ酸配合でおいしく飲みやすい！<br><br><font size=5>ランチタイムやイベント用途に丁度いい大きさ！</font><br><br>スポーツドリンクで手軽にアミノ酸補給。<br><br>体に必要な水分、ミネラルをおいしく素早く摂取できます。<br>甘さ控えめカロリーオフ、アミノ酸配合でさらにおいしく飲みやすくなりました。<br><br><br>■商品詳細<br><table width=630 border=1 cellspacing=0><tr><td bgcolor=#ffffcc><p style=margin:10px;>メーカー名：富永貿易<br>シリーズ名：神戸居留地<br>内容量：340g×2缶<br><br>購入単位：1セット(2缶)<br>配送種別：在庫品</p></td></tr></table><br><br>■原材料：果糖ぶどう糖液糖、塩化Ｎａ、酸味料、香料、塩化Ｋ、乳酸Ｃａ、甘味料（アセスルファムＫ）、アルギニン、グルタミン酸Ｎａ、ロイシン、イソロイシン、バリン、塩化Mg、V.C<br><br>■栄養成分：（100gあたり）<br>エネルギー（kcal）・・・19<br>たんぱく質（g）・・・0<br>脂質（g）・・・0<br>炭水化物（g）・・・4.7<br>ナトリウム（mg）・・・49<br>カリウム（mg）・・・22<br>マグネシウム（mg）・・・0.2<br>カルシウム（mg）・・・1.3<br>アルギニン（mg）・・・8<br>グルタミン酸（mg）・・・4<br>ロイシン（mg）・・・4<br>イソロイシン（mg）・・・4<br>バリン（mg）・・・4<br><br>■注意事項：<br>・開缶後はすぐにお飲みください。<br>・缶のまま凍らせないでください。内容液が膨張し、容器が破損する場合があります。<br>・品質保持のため窒素ガスを封入しておりますので缶を振らずにお開けください。<br>・あき缶の再資源化・散乱防止にご協力ください。<br><br><img src=http://image.rakuten.co.jp/onestep/cabinet/lpitem/notes/can_caution.jpg border=0><br><br><br><font size=1 color=#000000>【検索用キーワード】<br>楽天 通販 食品飲料・産直グルメ 水・ソフトドリンク ソフトドリンク 清涼飲料 100円均一 食品・飲料 ドリンク・お酒 こうべきょりゅうち すぽーつどりんくあくてぃーぶ 340ml 2かん  hf0527 HF0527 よろずやマルシェ　神戸居留地　アクティーブ　機能性　水分補給　スポーツドリンク　缶　缶ジューススポーツドリンク　スポーツ用飲料水　アミノ酸配合　AQTIVE　缶ジュース</font><br><style type="text/css">
